class CifthThresholdList(TextualConvention, OctetString):
    description = "A list of thresholds defined in a given template, in which each bit represents one threshold. The bits in the first octet represent thresholds identified by cifthThresholdIndex values 0 through 7, inclusive. The bits in the second octet represent thresholds identified by integer values 8 through 15, inclusive, and so forth. The least significant bit of an octet represents the threshold identified by the lowest integer value, and the most significant bit represents the threshold identified by the highest integer value. The figure shown below illustrates the format of a threshold list. Octet 1 Octet 8 7 6 5 4 3 2 1 0 7 6 5 4 3 2 1 0 +-+-+-+-+-+-+-+-+ +-+-+-+-+-+-+-+-+ | |...| | +-+-+-+-+-+-+-+-+ +-+-+-+-+-+-+-+-+ | | | | | | | | | | | | | | | | | | | | | | | | | | | | | | | +- Threshold 56 | | | | | | | | | | | | | | +--- Threshold 57 | | | | | | | | | | | | | +----- Threshold 58 | | | | | | | | | | | | +------- Threshold 59 | | | | | | | | | | | +--------- Threshold 60 | | | | | | | | | | +----------- Threshold 61 | | | | | | | | | +------------- Threshold 62 | | | | | | | | +--------------- Threshold 63 | | | | | | | | : | | | | | | | | : | | | | | | | +--------------------- Threshold 0 | | | | | | +----------------------- Threshold 1 | | | | | +------------------------- Threshold 2 | | | | +--------------------------- Threshold 3 | | | +----------------------------- Threshold 4 | | +------------------------------- Threshold 5 | +--------------------------------- Threshold 6 +----------------------------------- Threshold 7 A bit value of '1' indicates that the threshold is being exceeded in current operation (i.e., the threshold is fired). A bit value of '0' indicates that the threshold is not being exceeded in current operation (i.e., the threshold is cleared). A threshold list of length N, where N < 8, represents a threshold list for which thresholds N*8 through 63 have the value of '0'. A special case is a threshold list having a length of '0', which represents a threshold list of all zeros."
    status = 'current'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(0, 8)

class CifthThresholdSeverity(TextualConvention, Integer32):
    description = "The severity of the condition when the threshold is fired. A smaller enumerated integer value indicates that the threshold exceeded condition is more severe. The value 'fail' indicates a hard failure condition where no data can be received, or where the data received has a large number of errors which makes it impossible to recover most of the data. The value 'degrade' indicates a soft failure condition in which data received on this interface is affected, but a significant portion of the data can be recovered. The value 'info' is used to raise attention to a condition that could possibly be an impending problem or to notify the customer of an event that improves operation."
    status = 'current'
