if mibBuilder.loadTexts: cifthTemplateNotifyHoldDownType.setDescription("This object specifies the method used to prevent an excess of notifications from being generated when operation fluctuates around a threshold level. The value 'holdDownTimer' indicates that notifications for a given threshold and interface are suppressed for a short amount of time after each notification. The time value is specified in cifthTemplateNotifyHoldDownTime, which is instantiated only when this object is set to 'holdDownTimer'. After a notification is received for a given threshold and interface, the next notification for that threshold and interface will be generated after at least cifthTemplateNotifyHoldDownTime amount of time has passed, only when the threshold is next fired or cleared. The value 'fireAndClearThresholds' indicates that hysteresis is used. The management client configures two values for each threshold: one for asserting that the threshold has been exceeded (see cifthThresholdFiredValue), and a second value for asserting that the threshold is no longer being exceeded (see cifthThresholdClearedValue, which is instantiated only when this object is set to 'fireAndClearThresholds'). When this entry in cifthTemplateTable is active, this object may only be modified if there are no active entries in cifthThresholdTable with the same value of cifthTemplateIndex.")
