if mibBuilder.loadTexts: cifthThresholdType.setStatus('current')
if mibBuilder.loadTexts: cifthThresholdType.setDescription("The manner in which to compare cifthThresholdObject to cifthThresholdFiredValue and cifthThresholdClearedValue. The value 'absoluteValue' indicates that the value of cifthThresholdObject is to be compared directly to cifthThresholdFiredValue or cifthThresholdClearedValue. The value 'deltaValue' indicates that the difference between two successive samples of cifthThresholdObject is to be compared to cifthThresholdFiredValue or cifthThresholdClearedValue. The polling interval between successive samples is defined in cifthThresholdSampleInterval. The value 'rateOfIncreaseExponentXIfSpeed' indicates that the rate of increase of cifthThresholdObject is to be compared to the negated value of cifthThresholdFiredValue used as the exponent of 10, times the value of ifSpeed (if the value of ifSpeed is less than the maximum value) or ifHighSpeed (otherwise). For example, a value of cifthThresholdFiredValue of 5 on a gigabit ethernet interface indicates a threshold of 10^-5 times the interface speed, which is equal to 10,000 per second. When the value of this object is 'rateOfIncreaseExponentXIfSpeed', the polling interval between successive samples is determined automatically by the agent. When the object identified by cifthThresholdObject is a counter, a threshold type of 'deltaValue' or 'rateOfIncreaseExponentXIfSpeed' should be used. When the object identified by cifthThresholdObject is not a counter, a threshold type of 'absoluteValue' should be used.")
