if mibBuilder.loadTexts: cifthThresholdDirection.setStatus('current')
if mibBuilder.loadTexts: cifthThresholdDirection.setDescription("This object indicates which direction of movement causes the threshold to fire. The value 'rising' indicates that the threshold is fired when the current sampled value is numerically greater than or equal to the value of cifthThresholdFiredValue, and the threshold was considered to be cleared at the last sampling interval. If the value of the corresponding cifthTemplateNotifyHoldDownType object is 'fireAndClearThresholds', the threshold is cleared when the current sampled value is less than the value of cifthThresholdClearedValue, and the threshold was considered to be fired at the last sampling interval. If the value of the corresponding cifthTemplateNotifyHoldDownType object is other than 'fireAndClearThresholds', the threshold is cleared when the current sampled value is less than the value of cifthThresholdFiredValue, and the threshold was considered to be fired at the last sampling interval. The value 'falling' indicates that the threshold is fired when the current sampled value is numerically less than or equal to the value of cifthThresholdFiredValue, and the threshold was considered to be cleared at the last sampling interval. If the value of the corresponding cifthTemplateNotifyHoldDownType object is 'fireAndClearThresholds', the threshold is cleared when the current sampled value is greater than the value of cifthThresholdClearedValue, and the threshold was considered to be fired at the last sampling interval. If the value of the corresponding cifthTemplateNotifyHoldDownType object is other than 'fireAndClearThresholds', the threshold is cleared when the current sampled value is greater than the value of cifthThresholdFiredValue, and the threshold was considered to be fired at the last sampling interval.")
